CREATE TABLE IF NOT EXISTS USCounties (
    `Agency` VARCHAR(45) CHARACTER SET utf8,
    `State` VARCHAR(2) CHARACTER SET utf8,
    `Months` INT,
    `Population` INT,
    `Violent_crime_total` INT,
    `Murder_and_nonnegligent_Manslaughter` INT,
    `Legacy_rape_1` INT,
    `Revised_rape_2` INT,
    `Robbery` INT,
    `Aggravated_assault` INT,
    `Property_crime_total` INT,
    `Burglary` INT,
    `Larceny_theft` INT,
    `Motor_vehicle_theft` INT,
    `Violent_Crime_rate` NUMERIC(5, 1),
    `Murder_and_nonnegligent_manslaughter_rate` NUMERIC(4, 1),
    `Legacy_rape_rate_1` NUMERIC(4, 1),
    `Revised_rape_rate_2` NUMERIC(5, 1),
    `Robbery_rate` NUMERIC(4, 1),
    `Aggravated_assault_rate` NUMERIC(5, 1),
    `Property_crime_rate` NUMERIC(6, 1),
    `Burglary_rate` NUMERIC(5, 1),
    `Larceny_theft_rate` NUMERIC(6, 1),
    `Motor_vehicle_theft_rate` NUMERIC(5, 1)
);

